import React from "react";
import Index from "../components/Index";
import { ApolloProvider } from "@apollo/react-hooks";
import client from "./client"

const IndexPage = () => {
  return 
  <ApolloProvider client={client} >
    <Index />
    </ApolloProvider>;
};

export default IndexPage;
